import React, { Component } from 'react';
import api from '../../services/api.js';
import './style.css';

export default class RegisterClient extends Component {

  constructor(props) {
    super(props);
    // {
    // 	"first_name":"tiago",
    // 	"last_name":"vilela",
    // 	"email":"mail@mail.com",
    // 	"phone_number":"9832658741",
    // 	"cellphone_number":"98998524712",
    // 	"birthdate":"2021/01/01",
    // 	"CPF":12345678,
    // 	"RG":"5555"
    // }
    this.state = {
        first_name: "",
        last_name: "",
        email: "",
        phone_number: "",
        cellphone_number: "",
        birthdate: "",
        CPF: "",
        RG: ""
    }
  }

  RegisterClient = async () => {

    let headers = new Headers();
    headers.append('Content-Type', 'application/json');
    headers.append('Accept', 'application/json');
    headers.append('Access-Control-Allow-Origin', 'http://localhost:3000');
    headers.append('GET', 'POST', 'PUT', 'DELETE', 'OPTIONS');

    const response = await api.post('/client', this.state, headers)
    .then(response => {
      console.log(response);
      alert("cliente cadastrado");
    })
    .catch(error => {
      console.log(response);
      alert("erro so cadastrar cliente");
    });
  };

  render() {
    return (
      <div>
        <h2>Cadastro de Clientes</h2>

        <form>
          <div>
          <label>Digite o seu Nome:</label>
            <input name="first_name" type="type" value="" onChange=""/>

          </div>

          <div>
          <label>Digite o seu sobrenome:
            <input name="last_name" type="type" value="" onChange=""/>
          </label>
          </div>

          <div>
          <label>Digite o e-mail:
            <input name="email" type="type" value="" onChange=""/>
          </label>
          </div>

          <div>
          <label>Digite o numero de telefone:
            <input name="phone_number" type="type" value="" onChange=""/>
          </label>
          </div>

          <div>
          <label>Digite o numero celular:
            <input name="cellphone_number" type="type" value="" onChange=""/>
          </label>
          </div>

          <div>
          <label>Digite a sua data de nascimento:
            <input name="birthdate" type="type" value="" onChange=""/>
          </label>
          </div>

          <div>
          <label>Digite o seu CPF:
            <input name="CPF" type="type" value="" onChange=""/>
          </label>
          </div>

          <div>
          <label>Digite o seu RG:
            <input name="RG" type="type" value="" onChange=""/>
          </label>
          </div>

          <input type="submit" value="Cadastrar" />

        </form>
      </div>
    );
  }
}
